import React from "react";
import { Card } from "antd";
import "./ProjectCard.css";

const Meta = Card;

const ProjectCard = ({ coverSrc, title, description, overlay }) => (
  <Card
    style={{ width: {xl: 320, xl: 480} }}
    hoverable
    cover={<img className="cover-image" src={coverSrc} alt={title} />}
  >
    <Meta title={title} bordered={false} description={description} />
  </Card>
);

export default ProjectCard;
